      fetch("https://api.mfapi.in/mf/100049")
      .then(res => res.json())
      .then(obj =>{
        setColumn(object.keys(obj.data[0]))
        setRecords(obj.data)
      })
  },[])
  return(
     <div>
      <table className="tables">
        <thead>
          <tr>
            {column.map((c,i) => (
              <th key={i}>{c}</th>
            ))}
          </tr>
        </thead>

      </table>
     </div>
  )
}
export default App;
